import React from 'react';
import {
  View,
  Text,
  StyleSheet,
  ScrollView,
  TouchableOpacity,
  Image,
  Alert,
} from 'react-native';
import { Ionicons } from '@expo/vector-icons';
import { useAuth } from '../context/AuthContext';

const achievements = [
  { name: 'First Swap', description: 'Completed your first skill exchange', icon: 'üîÑ', earned: true },
  { name: '10 Successful Trades', description: 'Successfully completed 10 trades', icon: 'üèÜ', earned: true },
  { name: 'Community Mentor', description: 'Mentored 5 new members', icon: 'üë•', earned: true },
  { name: 'Top Rated', description: 'Consistently high ratings', icon: '‚≠ê', earned: true },
  { name: 'Helpful Swapper', description: 'Provided helpful advice', icon: '‚ù§Ô∏è', earned: false },
  { name: 'Skill Master', description: 'Mastered a new skill', icon: 'üõ°Ô∏è', earned: false },
];

const teachingSkills = [
  { name: 'Guitar', color: '#FFE4E1' },
  { name: 'Drawing', color: '#E8F5E8' },
  { name: 'Yoga', color: '#FFE4E1' },
];

const learningSkills = [
  { name: 'Cooking', color: '#FFF8DC' },
  { name: 'English', color: '#E0F6FF' },
  { name: 'Coding', color: '#E6E6FA' },
];

export default function ProfileScreen({ navigation }) {
  const { logout, user } = useAuth();

  const handleLogout = () => {
    Alert.alert(
      'Logout',
      'Are you sure you want to logout?',
      [
        {
          text: 'Cancel',
          style: 'cancel',
        },
        {
          text: 'Logout',
          style: 'destructive',
          onPress: async () => {
            try {
              await logout();
            } catch (error) {
              Alert.alert('Error', 'Failed to logout. Please try again.');
            }
          },
        },
      ]
    );
  };
  return (
    <ScrollView style={styles.container}>
      <View style={styles.header}>
        <TouchableOpacity
          style={styles.settingsButton}
          onPress={() => navigation.navigate('Settings')}
        >
          <Ionicons name="settings-outline" size={24} color="#333" />
        </TouchableOpacity>
        <View style={styles.headerRight}>
          <TouchableOpacity style={styles.shareButton}>
            <Ionicons name="share-outline" size={24} color="#333" />
          </TouchableOpacity>
          <TouchableOpacity style={styles.logoutButton} onPress={handleLogout}>
            <Ionicons name="log-out-outline" size={24} color="#FF6B6B" />
          </TouchableOpacity>
        </View>
      </View>

      <View style={styles.profileSection}>
        <View style={styles.avatarContainer}>
          <Image
            source={{ uri: 'https://via.placeholder.com/120x120/4CAF50/FFFFFF?text=SI' }}
            style={styles.profileImage}
          />
        </View>
        <Text style={styles.name}>{user?.name || 'Sauban Islam'}</Text>
        <View style={styles.ratingContainer}>
          <Ionicons name="star" size={16} color="#FFD700" />
          <Text style={styles.rating}>4.8 (125 reviews)</Text>
        </View>
        <View style={styles.levelContainer}>
          <Text style={styles.levelBadge}>Level 3</Text>
          <Text style={styles.points}>2500 Points</Text>
        </View>
      </View>

      <View style={styles.skillsSection}>
        <Text style={styles.sectionTitle}>I Can Teach</Text>
        <View style={styles.skillsContainer}>
          {teachingSkills.map((skill, index) => (
            <View key={index} style={[styles.skillTag, { backgroundColor: skill.color }]}>
              <Text style={styles.skillText}>{skill.name}</Text>
            </View>
          ))}
        </View>

        <Text style={styles.sectionTitle}>I Want to Learn</Text>
        <View style={styles.skillsContainer}>
          {learningSkills.map((skill, index) => (
            <View key={index} style={[styles.skillTag, { backgroundColor: skill.color }]}>
              <Text style={styles.skillText}>{skill.name}</Text>
            </View>
          ))}
        </View>
      </View>

      <View style={styles.achievementsSection}>
        <Text style={styles.sectionTitle}>Badges</Text>
        <View style={styles.badgesGrid}>
          {achievements.map((achievement, index) => (
            <View key={index} style={[styles.badgeCard, !achievement.earned && styles.lockedBadge]}>
              <Text style={styles.badgeIcon}>{achievement.icon}</Text>
              <Text style={[styles.badgeName, !achievement.earned && styles.lockedText]}>
                {achievement.name}
              </Text>
              <Text style={[styles.badgeDescription, !achievement.earned && styles.lockedText]}>
                {achievement.description}
              </Text>
            </View>
          ))}
        </View>
      </View>

      <View style={styles.progressSection}>
        <Text style={styles.sectionTitle}>Progress</Text>
        <View style={styles.experienceContainer}>
          <Text style={styles.experienceLabel}>Experience Level</Text>
          <View style={styles.progressBar}>
            <View style={styles.progressFill} />
          </View>
          <View style={styles.experienceLabels}>
            <Text style={styles.experienceText}>Beginner</Text>
            <Text style={styles.experienceText}>Mentor</Text>
          </View>
        </View>
      </View>

      <View style={styles.logoutSection}>
        <TouchableOpacity style={styles.logoutCard} onPress={handleLogout}>
          <View style={styles.logoutContent}>
            <Ionicons name="log-out-outline" size={24} color="#FF6B6B" />
            <Text style={styles.logoutText}>Logout</Text>
          </View>
          <Ionicons name="chevron-forward" size={20} color="#FF6B6B" />
        </TouchableOpacity>

        <Text style={styles.logoutSubtext}>
          You'll need to sign in again to access your account
        </Text>
      </View>
    </ScrollView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    paddingTop: 50,
  },
  header: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    paddingHorizontal: 20,
    marginBottom: 20,
  },
  headerRight: {
    flexDirection: 'row',
    alignItems: 'center',
  },
  settingsButton: {
    padding: 8,
  },
  shareButton: {
    padding: 8,
    marginRight: 8,
  },
  logoutButton: {
    padding: 8,
  },
  profileSection: {
    alignItems: 'center',
